from pathlib import Path
import json, math

target_path = Path('/mnt/data').joinpath('outputs/examples/benchmark_case_001.json')
target_path.parent.mkdir(parents=True, exist_ok=True)

data = [1, 2, 3, 4, 5]
n = len(data)
s = sum(data)
mean = s / n
var_pop = sum((x-mean)**2 for x in data) / n
std_pop = math.sqrt(var_pop)

benchmark = {
  "schema_version": "1.0.0",
  "case_id": "benchmark_case_001",
  "name": "Basic statistics on small integer dataset",
  "description": "Deterministic end-to-end benchmark: compute basic statistics on a small integer vector.",
  "computation": {
    "type": "basic_statistics",
    "version": "v1",
    "parameters": {
      "variance": "population"
    }
  },
  "inputs": {
    "data": data
  },
  "expected_outputs": {
    "count": n,
    "sum": s,
    "mean": mean,
    "min": min(data),
    "max": max(data),
    "variance": var_pop,
    "std_dev": std_pop
  },
  "comparison": {
    "numeric_tolerance": {
      "abs": 1e-12,
      "rel": 1e-12
    }
  }
}

chunks = [json.dumps(benchmark, indent=2, sort_keys=False)]
final_text = '\n'.join(block.strip('\n') for block in chunks).strip() + '\n'
target_path.write_text(final_text, encoding='utf-8')

print('FILE_WRITTEN:outputs/examples/benchmark_case_001.json')
print('DIR_STATE:' + json.dumps(sorted(str(p.relative_to(Path("/mnt/data"))) for p in target_path.parent.glob('*') if p.is_file())))
